import { globalCSS, fonts } from '../styles';

export default function Index() {
  return (
    <div>
      <h1>Hello Next Website</h1>
      <style>{`
        h1 {
          font-family: ${fonts.serif};
        }
      `}</style>
      <style global jsx>{`
        ${globalCSS}
        body {
          background: pink;
        }
      `}</style>
    </div>
  )
}
